function initmap() {
	// set up the map
	map = new L.Map('VoterMap');

	// create the tile layer with correct attribution
	var osmUrl='http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png';
	var osmAttrib='Map data  OpenStreetMap contributors';
	var osm = new L.TileLayer(osmUrl, {minZoom: 8, maxZoom: 12, attribution: osmAttrib});

	// Create School Board Map Layer
	var geojsonLayer = new L.GeoJSON();
	geojsonLayer.on("featureparse", function (e) {
		if (e.properties.NAME10) {
			e.layer.bindPopup(e.properties.NAME10);
		}
	});
	geojsonLayer.addGeoJSON(schoolsJson);
	
	// start the map in Wilmington
	map.setView(new L.LatLng(39.745845,-75.546944),10);
	map.addLayer(osm);
	map.addLayer(geojsonLayer);
};

function myGeocoder(address) {
	geocoder = new google.maps.Geocoder();

	geocoder.geocode( { 'address': address}, function(results, status) {
		if (status == google.maps.GeocoderStatus.OK) {
			var latlng = new L.LatLng(results[0].geometry.location.Ua, results[0].geometry.location.Va);
			map.setView(latlng, 15, true);
			var point = map.latLngToLayerPoint(latlng);
			var X = $("#VoterMap").offset().top + point.x;
			var Y = $("#VoterMap").offset().left + point.y;
		} else {
			alert("Sorry. We could not find your address.");
		};
		$(document.elementFromPoint(X, Y)).click();

	});
};